import React from 'react';
import Fashion from "./img/FASHION.png"

export default function Header() {
    return (
        <header className="header">
            <div>
                <img src="./img/FASHION.png" alt="Fashion Logo" />
            </div>
            <div>
                <a href="">
                    <img src="./img/shopping_cart_icon.png" alt="Shopping Cart" />
                </a>
            </div>
        </header>
    );
}
